import React from 'react';

const TreeNode = ({ value, children }) => (
  <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
    <div style={{ backgroundColor: '#ccc', width: '50px', height: '50px', borderRadius: '50%', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      {value}
    </div>
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginLeft: '20px' }}>
      {children}
    </div>
  </div>
);

const NodeTree = () => (
  <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
    <TreeNode value="A">
      <TreeNode value="B">
        <TreeNode value="C" />
        <TreeNode value="D" />
      </TreeNode>
      <TreeNode value="E" />
    </TreeNode>
  </div>
);

export default NodeTree;
